-- немного причешем данные для правдоподобности
UPDATE countries SET updated_at = NOW() WHERE updated_at < created_at;
UPDATE movies SET updated_at = NOW() WHERE updated_at < created_at;
UPDATE profiles SET updated_at = NOW() WHERE updated_at < created_at;
UPDATE reviews SET updated_at = NOW() WHERE updated_at < created_at;
UPDATE scores SET updated_at = NOW() WHERE updated_at < created_at;
UPDATE user_marks SET updated_at = NOW() WHERE updated_at < created_at;
UPDATE users SET updated_at = NOW() WHERE updated_at < created_at;

CREATE TEMPORARY TABLE extensions (name CHAR(3));

UPDATE trailers SET filename = CONCAT (
	'https://dropbox.com/vk/',
	filename,
	'.',
	(SELECT name FROM extensions ORDER BY RAND() LIMIT 1)
);

-- у нас могут быть профили без gender/birthday/photo_id, смоделируем ситуацию
UPDATE profiles SET gender = NULL WHERE user_id = (1+FLOOR(RAND()*100)); -- повторить несколько раз
UPDATE profiles SET birthday = NULL WHERE user_id = (1+FLOOR(RAND()*100)); -- повторить несколько раз
UPDATE profiles SET photo_id = NULL WHERE user_id = (1+FLOOR(RAND()*100)); -- повторить несколько раз
